import React from 'react';
import { Tweet } from './Tweet.js'
import './style.css'

function App() {
  const data = [{
    name: 'Nader TalebZadeh',
    text: 'Компания Mercedes-Benz в Граце представила новое поколение утилитарного G-Class W464. Частные лица купить его не смогут. Он предназначен для военных, МВД и прочих госструктур. И он сильно отличается от гражданского «Гелика».',
    retweet: 88,
    comments: 313,
    likes: 10,
    time: 10
  },

  {
    name: 'Samvel Ireeb',
    text: 'Компания Mercedes-Benz в Граце представила новое поколение утилитарного G-Class W464. Частные лица купить его не смогут. Он предназначен для военных, МВД и прочих госструктур. И он сильно отличается от гражданского «Гелика».',
    retweet: 34,
    comments: 1423,
    likes: 22,
    time: 14
  },

  {
    name: 'ALeksye Pchela',
    text: 'Компания Mercedes-Benz в Граце представила новое поколение утилитарного G-Class W464. Частные лица купить его не смогут. Он предназначен для военных, МВД и прочих госструктур. И он сильно отличается от гражданского «Гелика».',
    retweet: 244,
    comments: 144,
    likes: 77,
    time: 1
  }
]
  return (   
    <div>
      {data.map((tweet, idx) => {
        return (
          <Tweet {...tweet} key={idx} />
        )
      })}
    </div>
  );
}

export default App;
